class ChatBubble(QFrame):
    def __init__(self, text: str = "", sender: str = "", is_user: bool = True, loading: bool = False,
                 use_custom_wrap: bool = False, minimum_width: int = 200, maximum_width: int = 400,
                 no_ui: bool = False):
        super().__init__()
        self.text = text
        self.sender_ = sender
        self.is_user = is_user

        self.loading = loading
        self.loadingAnimation = None

        self.use_custom_wrap = use_custom_wrap
        self.minimum_width = minimum_width
        self.maximum_width = maximum_width

        if not no_ui:
            self.textLabel: Optional[QLabel] = None
            self.loadingLabel: Optional[QLabel] = None
            self.loadingLayout: Optional[QHBoxLayout] = None
            self.loadingFrame: Optional[QFrame] = None
            self.init_ui()
            self.update_text(text)

    @staticmethod
    def ready_text(text: str, limit: int) -> str:
        # Function to format the text to wrap at the character limit
        if not text or limit <= 0:
            return ""

        words = text.split()
        wrapped_text = ""
        line_length = 0

        for word in words:
            if len(word) > limit:
                # If the word itself exceeds the limit, split the word
                if line_length > 0:
                    wrapped_text += '\n'  # Start a new line if there is already text
                    line_length = 0

                while len(word) > limit:
                    wrapped_text += word[:limit] + '\n'
                    word = word[limit:]

                # Add the remaining part of the word to the line
                wrapped_text += word + ' '
                line_length = len(word) + 1
            elif line_length + len(word) <= limit:
                # Add the word to the current line
                wrapped_text += word + ' '
                line_length += len(word) + 1
            else:
                # Start a new line if the word doesn't fit
                wrapped_text += '\n' + word + ' '
                line_length = len(word) + 1

        return wrapped_text  # .strip()

    def calculate_char_limit(self):
        metrics = QFontMetrics(self.font())
        average_char_width = metrics.averageCharWidth()
        parent_width = max(self.minimum_width,
                           min(self.maximum_width,
                               self.parentWidget().width() if self.parentWidget() else self.width()
                               ))
        return max(10, parent_width // average_char_width)

    def update_text(self, text: str):
        finished_text = text
        if self.use_custom_wrap:
            # Calculate character limit based on current width
            char_limit = self.calculate_char_limit()
            finished_text = self.ready_text(text, char_limit)
        self.textLabel.setText(finished_text)

    def init_ui(self):
        layout = QVBoxLayout()

        info_label = QLabel(f"{self.sender_} - {QDateTime.currentDateTime().toString('hh:mm:ss')}")
        info_label.setStyleSheet("font-size: 8pt; color: gray;")

        self.textLabel = QLabel()
        if not self.use_custom_wrap:
            self.textLabel.setWordWrap(True)
        self.textLabel.setStyleSheet("background-color: transparent;")

        self.setMinimumWidth(self.minimum_width)
        self.setMaximumWidth(self.maximum_width)

        # Update size policy to prefer minimum space but allow expansion
        self.textLabel.setSizePolicy(QSizePolicy.Policy.Preferred, QSizePolicy.Policy.MinimumExpanding)
        self.setSizePolicy(QSizePolicy.Policy.Preferred, QSizePolicy.Policy.Minimum)
        self.textLabel.setContentsMargins(5, 5, 5, 5)

        layout.addWidget(info_label)
        layout.addWidget(self.textLabel)
        layout.setSpacing(4)
        layout.setContentsMargins(10, 5, 10, 5)

        if self.loading:
            self.textLabel.hide()
            # Setup for loading animation
            self.loadingFrame = QFrame(self)
            loadingLabel = QLabel(self)
            decompressed_data = brotli.decompress(LOADING_ANIM)

            # Create a QBuffer from the decompressed data
            buffer = QBuffer()
            buffer.setData(QByteArray(decompressed_data))
            buffer.open(QBuffer.ReadOnly)

            # Use the buffer with QMovie
            self.loadingAnimation = QMovie()
            self.loadingAnimation.setCacheMode(QMovie.CacheMode.CacheAll)
            self.loadingAnimation.setDevice(buffer)
            self.loadingAnimation.setScaledSize(QSize(128, 128))
            loadingLabel.setMovie(self.loadingAnimation)
            loadingLabel.setFixedSize(QSize(120, 80))
            loadingLayout = QHBoxLayout(self.loadingFrame)
            loadingLayout.addStretch(1)
            loadingLayout.addWidget(loadingLabel, alignment=Qt.AlignmentFlag.AlignCenter)  # Center horizontally
            loadingLayout.addStretch(2)
            layout.addWidget(self.loadingFrame)
            self.loadingAnimation.start()

        if self.is_user:
            layout.setAlignment(Qt.AlignmentFlag.AlignRight)
            self.setStyleSheet("background-color: lightgreen; border-radius: 10px; border-bottom-right-radius: 0px;")
            self.textLabel.setAlignment(Qt.AlignmentFlag.AlignRight)
            info_label.setAlignment(Qt.AlignmentFlag.AlignRight)
        else:
            layout.setAlignment(Qt.AlignmentFlag.AlignLeft)
            self.setStyleSheet("background-color: lightblue; border-radius: 10px; border-bottom-left-radius: 0px;")
            self.textLabel.setAlignment(Qt.AlignmentFlag.AlignLeft)
            info_label.setAlignment(Qt.AlignmentFlag.AlignLeft)
        self.setLayout(layout)

    def update_content(self, new_text):
        # Call this method to update text and stop loading animation
        if not self.textLabel.isVisible():
            self.textLabel.show()
            self.loadingAnimation.stop()
            if self.loadingFrame:
                self.loadingFrame.hide()
                self.layout().removeWidget(self.loadingFrame)
                self.loadingFrame.deleteLater()
                self.loadingFrame = None

        self.text = new_text
        self.update_text(self.text)

    def resizeEvent(self, event: QResizeEvent) -> None:
        self.update_text(self.text)
        return super().resizeEvent(event)


class MDChatBubble(ChatBubble):
    def __init__(self, text: str = "", sender: str = "", is_user: bool = True, loading: bool = False,
                 minimum_width: int = 200, maximum_width: int = 400, width_offset: int = 15, no_ui: bool = False):
        super().__init__(text, sender, is_user, loading, False, minimum_width, maximum_width, True)
        self.width_offset = width_offset

        if not no_ui:
            self.textLabel = self.loadingLabel = None
            self.init_ui()
            self.update_text(text)

    def update_text(self, text: str):
        # Calculate character limit based on current width
        char_limit = self.calculate_char_limit()
        wrapped_text = self.ready_text(text, char_limit)
        # Save Markdown to a temporary file
        temp_file, temp_path = tempfile.mkstemp(suffix='.md')  # Creates a temp file
        with os.fdopen(temp_file, 'w') as file:
            file.write(wrapped_text)
        # Create a QUrl and load it into QTextBrowser
        url = QUrl.fromLocalFile(temp_path)
        self.textLabel.setSource(url)
        char_height = self.calculate_char_height(wrapped_text)
        self.textLabel.setFixedHeight(char_height)

    @staticmethod
    def interpolate(value, x_points, y_points):
        # Ensure the value is within the bounds of the x_points
        if value <= min(x_points):
            return y_points[0]
        if value >= max(x_points):
            return y_points[-1]

        # Find the interval the value falls into
        for i in range(len(x_points) - 1):
            if x_points[i] <= value <= x_points[i + 1]:
                # Perform linear interpolation
                x0, y0 = x_points[i], y_points[i]
                x1, y1 = x_points[i + 1], y_points[i + 1]
                return y0 + (y1 - y0) * (value - x0) / (x1 - x0)

    def calculate_char_height(self, text):
        metrics = QFontMetrics(self.font())
        char_height = metrics.height()
        line_count = len(text.split("\n"))
        print(text.split("\n"))
        # (lines * char_height) + ((3.201449 + (3.290262 - 3.201449)/(1 + (lines/527.4672)**3.500717))
        x_points = [1, 2, 3, 6, 11, 17, 23, 28, 56, 278, 556, 2778, 5556, 11111, 16667, 22223]
        y_points = [11, 4, 8, 4, 5.1, 3.3, 3.3, 3.3, 3.29, 3.25, 3.21, 3.203, 3.201, 3.2019, 3.2002, 3.20007]

        multiplier = self.interpolate(line_count, x_points, y_points)
        print(multiplier, line_count)
        return max(20, (line_count * char_height) + (multiplier * line_count))  # (5.36 * lines -> 1000)  (1.112 ** lines -> 100)  (lines ** 1.2702 --> 1000)

    def init_ui(self):
        layout = QVBoxLayout()

        info_label = QLabel(f"{self.sender_} - {QDateTime.currentDateTime().toString('hh:mm:ss')}")
        info_label.setStyleSheet("font-size: 8pt; color: gray;")

        self.textLabel = QTextBrowser()
        self.textLabel.setOpenExternalLinks(True)
        self.textLabel.setStyleSheet("background-color: transparent;")
        self.textLabel.setVerticalScrollBarPolicy(Qt.ScrollBarPolicy.ScrollBarAlwaysOff)
        self.textLabel.setHorizontalScrollBarPolicy(Qt.ScrollBarPolicy.ScrollBarAlwaysOff)

        self.setMinimumWidth(self.minimum_width)
        self.setMaximumWidth(self.maximum_width)

        # Update size policy to prefer minimum space but allow expansion
        self.textLabel.setSizePolicy(QSizePolicy.Policy.Preferred, QSizePolicy.Policy.MinimumExpanding)  # Needed?
        self.setSizePolicy(QSizePolicy.Policy.Preferred, QSizePolicy.Policy.Minimum)

        layout.addWidget(info_label)
        layout.addWidget(self.textLabel)
        layout.setSpacing(4)
        layout.setContentsMargins(10, 5, 10, 5)

        if self.loading:
            # Setup for loading animation
            self.loadingLabel = QLabel(self)
            decompressed_data = brotli.decompress(LOADING_ANIM)

            # Create a QBuffer from the decompressed data
            buffer = QBuffer()
            buffer.setData(QByteArray(decompressed_data))
            buffer.open(QBuffer.ReadOnly)

            # Use the buffer with QMovie
            self.loadingAnimation = QMovie()
            self.loadingAnimation.setCacheMode(QMovie.CacheMode.CacheAll)
            self.loadingAnimation.setDevice(buffer)
            self.loadingAnimation.setScaledSize(QSize(128, 128))
            self.loadingLabel.setMovie(self.loadingAnimation)
            self.loadingLabel.setFixedSize(QSize(120, 80))
            layout.addStretch()
            layout.addWidget(self.loadingLabel, alignment=Qt.AlignmentFlag.AlignCenter)  # Center horizontally
            layout.addStretch()
            self.loadingAnimation.start()

        if self.is_user:
            layout.setAlignment(Qt.AlignmentFlag.AlignRight)
            self.setStyleSheet("background-color: lightgreen; border-radius: 10px; border-bottom-right-radius: 0px;")
            self.textLabel.setAlignment(Qt.AlignmentFlag.AlignRight)
            info_label.setAlignment(Qt.AlignmentFlag.AlignRight)
        else:
            layout.setAlignment(Qt.AlignmentFlag.AlignLeft)
            self.setStyleSheet("background-color: lightblue; border-radius: 10px; border-bottom-left-radius: 0px;")
            self.textLabel.setAlignment(Qt.AlignmentFlag.AlignLeft)
            info_label.setAlignment(Qt.AlignmentFlag.AlignLeft)
        self.setLayout(layout)

    def update_content(self, new_text):
        # Call this method to update text and stop loading animation
        self.text = new_text
        self.update_text(self.text)
        self.loadingAnimation.stop()
        self.loadingLabel.hide()
        self.layout().removeWidget(self.loadingLabel)
        self.loadingLabel.deleteLater()

    def resizeEvent(self, event: QResizeEvent) -> None:
        self.update_text(self.text)
        parent = self.parent()
        while parent.parent() is not None:
            if isinstance(parent, QScrollArea):
                break
            parent = parent.parent()
        if parent is not None and isinstance(parent, QScrollArea):
            offset_width = parent.viewport().width() - self.width_offset
            self.setMinimumWidth(min(offset_width, self.minimum_width))
            self.setMaximumWidth(min(offset_width, self.maximum_width))
        return super().resizeEvent(event)


class ChatArea(QScrollArea):
    def __init__(self, parent=None):
        super().__init__(parent=parent)
        self.setVerticalScrollBarPolicy(Qt.ScrollBarPolicy.ScrollBarAlwaysOn)
        self.setHorizontalScrollBarPolicy(Qt.ScrollBarPolicy.ScrollBarAlwaysOff)
        self.setWidgetResizable(True)

        self.content = QWidget()
        self.layout = QVBoxLayout()
        self.layout.setAlignment(Qt.AlignmentFlag.AlignTop)
        self.layout.addStretch(1)
        self.content.setLayout(self.layout)
        self.setWidget(self.content)

        self.messages = []

    def send_chat_message(self, text: str = "", sender: str = "", is_user: bool = True,
                          is_loading: bool = False) -> ChatBubble:
        bubble = ChatBubble(text, sender, is_user, loading=is_loading)
        self.update_conversation(bubble)
        self.messages.append(bubble)
        return bubble

    def send_chat_messages(self, texts: list, senders: list, is_user_list: list, is_loading_list: list) -> list:
        num = len(texts) + len(senders) + len(is_user_list) + len(is_loading_list) // 4
        return_lst = []
        for i in range(num):
            bubble = self.send_chat_message(texts[i], senders[i], is_user_list[i], is_loading_list[i])
            return_lst.append(bubble)
        return return_lst

    def update_conversation(self, chat_bubble: Union[ChatBubble, MDChatBubble]) -> Union[QWidget, QHBoxLayout]:
        # Create a horizontal layout to control the side alignment
        bubble_layout = QHBoxLayout()
        bubble_layout.addWidget(chat_bubble)
        # bubble_layout.setContentsMargins(0, 0, 0, 0)

        if chat_bubble.is_user:
            bubble_layout.insertStretch(0, 1)  # Add stretch to right to push bubble left
            bubble_layout.setContentsMargins(20, 0, 0, 0)  # Left margin
        else:
            bubble_layout.addStretch()  # Add stretch to left to push bubble right
            bubble_layout.setContentsMargins(0, 0, 20, 0)  # Right margin

        # Create a wrapper widget to hold the layout
        wrapper_widget = QWidget()
        wrapper_widget.setLayout(bubble_layout)
        self.layout.addWidget(wrapper_widget)

        return wrapper_widget

    def get_all_messages(self):
        return self.messages

    def get_all_messages_from_sender(self, sender: str) -> list:
        return_lst = []
        for bubble in self.messages:
            if bubble.sender_ == sender:
                return_lst.append(bubble)
        return return_lst

    def get_all_messages_from_senders(self, senders: List[str]) -> Dict[str, list]:
        return_dict: Dict[str, list] = {sender: [] for sender in senders}
        for bubble in self.messages:
            if bubble.sender_ in senders:
                return_dict[bubble.sender_].append(bubble)
        return return_dict

    def resizeEvent(self, event: QResizeEvent):
        super().resizeEvent(event)
        for bubble in self.messages:
            bubble.resizeEvent(event)


